import './App.css';
import React, { Fragment, useState } from 'react';
import { Button, TextField, Icon } from '@material-ui/core';

const [context, setContext] = useState("");
const [name, setName] = useState("");
const [regDate, setRegDate] = useState("");

// TextField Name Component
function RowName({ name }) {
  return (
    <div className="rowName">
      <label>Name</label>
      <TextField
        className="inputName"
        id="outlined-basic"
        variant="outlined"
        size="small"
        value={setName}
      />
    </div>
  );
}

// TextField Date Component
function RowDate() {
  return (
    <div className="rowDate">
      <label>Date</label>
      <TextField
        className="inputDate"
        id="date"
        type="date"
        defaultValue="2017-05-24"
        InputLabelProps={{
          shrink: true,
        }}
      />
    </div>
  );
}

// Button Component
function SendBtn() {


  const onChange = (e) => {
    const { name, regDate, context } = e.target;
    alert(name, regDate, context);
  }

  return (
    <div className="sendBtn">
      <Button
        variant="contained"
        color="primary"
        endIcon={<Icon>send</Icon>}
        onClick={onChange}
        value
      >
        Send
    </Button>
    </div>
  );
}

// TextField Context Component
function RowContext() {
  return (
    <div className="rowContent">
      <label>Context</label>
      <TextField
        className="inputContext"
        id="outlined-basic"
        variant="outlined"
        fullWidth={true}
        rows={15}
        multiline
        value={() => { setName() }}
      />
    </div>
  );
}

function App() {

  return (
    <Fragment>
      <div className="mainGrid">
        <form className="inputForm">
          <div className="rowNameDate">
            <RowName />
            <RowDate />
          </div>
          <RowContext />
        </form>
        <SendBtn />
      </div>
    </Fragment>
  );
}

export default App;
